/**
 * Created by Lenovo on 2019/8/7.
 */
import axios from "axios";
import Config from './envConfig';
import {Toast} from 'antd-mobile';
export function getData(method,url,data,successCB,failCB){
    Toast.loading('加载中...', 0);
    axios({
        method: method||'post',
        url: Config.serverUrl+url,
        data: data
    }).then(function (res) {
        if(successCB){
            Toast.hide();
            let result = res.data.data;
            console.log(res)
            if(result.code == 0){
                Toast.success(result.msg,1);
                successCB(res.data);
            }
        }
    }).catch(function (err) {
        if(failCB){
            failCB(err);
        }
    });
}
export function isDefine() {

}

export function goNext(that,pathname,state) {
    console.log(that);
    if(state ||state==0){
        that.props.history.push({pathname:pathname,state:state});
    }else {
        that.props.history.push(pathname);
    }
}
